import axios from 'axios'
import {
    Chart as ChartJS,
    RadialLinearScale,
    PointElement,
    LineElement,
    Filler,
    Tooltip,
    Legend,
  } from 'chart.js';
  import { Radar } from 'react-chartjs-2';
  
  ChartJS.register(
    RadialLinearScale,
    PointElement,
    LineElement,
    Filler,
    Tooltip,
    Legend
  );

export default function MarksRadar(){
    //  const data = {
    //     labels: ['Stochastic', 'SDA', 'OS', 'Database', 'Linear'],
    //     datasets: [
    //       {
    //         label: '# of Votes',
